import React from "react";
import Header from "./Header.jsx";
import Note from "./Note.jsx"
import Footer from "./Footer.jsx";

import notes from "../notes.js";

function App() {
    return(
        <div>
        <Header />
         
         {notes.map(createNote => (
            <Note
             name = {createNote.title}
             content = {createNote.content}
             />
         ))}
        
        <Footer />

        </div>
    );
}

export default App;
